DROP TABLE IF EXISTS `sys_mobile_message`;
CREATE TABLE `sys_mobile_message`  (
  `id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `to_userid` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '收信人id',
  `to_username` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '收信人登录帐号',
  `to_mobile` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `to_name` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '收信人姓名',
  `message` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '短信内容',
  `send_time` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发送时间',
  `type` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '短信类型。1：自动发送.2：主动发送',
  `message_platfrom` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '短信平台',
  `send_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发送唯一id，用来查询',
  `if_success` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否成功。0：不成功。1：成功',
  `code` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '返回编码。\r\n0	发送短信成功\r\n1	提交参数不能为空\r\n2	账号无效或权限不足\r\n3	账号密码错误,\r\n4	预约发送时间格式不正确，应为yyyyMMddHHmmss\r\n5	IP不合法,\r\n6	号码中含有无效号码或不在规定的号段或为免打扰号码（包含系统黑名单号码）\r\n7	非法关键字\r\n8	内容长度超过上限，最大402字或字符\r\n9	接受号码过多，最大1000\r\n11	提交速度太快\r\n12	您尚未订购[普通短信业务]，暂不能发送该类信息\r\n13	您的[普通短信业务]剩余数量发送不足，暂不能发送该类信息\r\n14	流水号格式不正确\r\n15	流水号重复\r\n16	超出发送上限（操作员帐户当日发送上限）\r\n17	余额不足\r\n18	扣费不成功\r\n20	系统错误\r\n21	密码错误次数达到5次\r\n24	帐户状态不正常\r\n25	账户权限不足\r\n26	需要人工审核\r\n28	发送内容与模板不符\r\n29	扩展号太长或不是数字&accnum=\r\n32	同一号码相同内容发送次数太多（默认24小时内，验证码类发送5次或相同内容2次以上会报此错误。）\r\n33	同一号码验证码提交过快（间隔小于60s会报此错误）',
  `res_des` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '返回描述信息',
  `fail_list` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发送失败的手机号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

